import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

const routes = [
  {
      path: "/",
      exact: true,
      main: () => <h2>Home</h2>
  },
  {
      path: "/analytics",
      main: () => <h2>Analytics</h2>
  },

]

class Content extends Component {
  render() {

    return (
      <div>
        <Switch>
          {routes.map((route, inde))}
        </Switch>
      </div>
    );
  }
}

export default Content;
